import logo200Image from 'assets/img/logo/logo_200.png';
import React from 'react';
import { Button,   Card,
  CardBody,
  CardImg,
  CardImgOverlay,
  CardLink,
  CardText,
  CardTitle,
  Col,
  Row, } from 'reactstrap';
import { withRouter, Link } from "react-router-dom";

class BlankPage extends React.Component {
  constructor() {
    super()
    this.state = {
      modal: true,
      modal_backdrop: false,
      modal_nested_parent: false,
      modal_nested: false,
      backdrop: true,
    }

  }

  redirect(e) {
    e.preventDefault()
    //localStorage.removeItem('usertoken')
    this.props.history.push(`/iot_test`)
  }
 
  toggle = modalType => () => {
    if (!modalType) {
      return this.setState({
        modal: !this.state.modal,
      });
    }
    this.setState({
      [`modal_${modalType}`]: !this.state[`modal_${modalType}`],
    });
  };
  render() {


    return (
     <Row>
           <Card>
              <CardBody>
                <CardTitle>Vous Pouvez ici r√©server une carte</CardTitle>
                <CardText>
                  Contenu
              </CardText>
              </CardBody>
            </Card>
     </Row>
    );
  }
}



export default withRouter(BlankPage);
